// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract AramidUSDToken is ERC20 {
    uint8 private _decimals;
    address public bridgeContract;

    constructor(
        string memory name,
        string memory symbol,
        address _bridgeContract,
        uint8 _chosenDecimals
    ) ERC20(name, symbol) {
        _decimals = _chosenDecimals;
        bridgeContract = _bridgeContract;
        _mint(bridgeContract, 10**9 * 10**18);
    }

    /**
     * Allow anybody to mint new 100 tokens - testnet token
     */
    function mintNew() public {
        _mint(msg.sender, 10**2 * 10**18);
    }

    /**
     * @dev Returns the number of decimals used to get its user representation.
     * For example, if `decimals` equals `2`, a balance of `505` tokens should
     * be displayed to a user as `5.05` (`505 / 10 ** 2`).
     *
     * NOTE: This information is only used for _display_ purposes: it in
     * no way affects any of the arithmetic of the contract, including
     * {IERC20-balanceOf} and {IERC20-transfer}.
     */
    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }
}
